pwdPolicyPortalDesc:"Du kan angi passordpolicyen for alle medlemmer som har innebygde kontoer p\u00e5 portalen, for \u00e5 definere regler som bestemmer hvilket format passordene som medlemmene oppgir, skal ha. Du kan ogs\u00e5 angi hvor lenge passordene skal v\u00e6re gyldige, og hvor mange passord som skal beholdes i historikken slik at nye passord kan sammenlignes med disse for \u00e5 unng\u00e5 at tidligere brukte passord brukes p\u00e5 nytt.",updatePwdPolicy:"Oppdater passordpolicy",useDefaultPwdPolicy:"Bruk ArcGIS' standardpolicy",
